import React, { Component } from 'react';

class IntroSlides extends Component {
	render() {
		return (
			<div id="introSlides">
				<div className="background"></div>
				<div className="text">
					<h1>Frontend Developer. Psychologist. Entrepreneur.</h1>
				</div>
        <div className="image"></div>
			</div>
		);
	}
}

export default IntroSlides;
